import React, { Component } from 'react'
import PracticeDraft from './PracticeDraft'

class RenderingSpace extends Component { 

    render() {
        return (
            <div>
                <div className="bodyText">
                    <PracticeDraft />
                </div>
            </div>
        )
    }
}

export default RenderingSpace;
